(74738, 236212, 6770, 1, '崩裂前聲嘶力竭', '我是你的守護者 我會永遠守護在你的身邊\n賴銘偉與黃美珍 神木與瞳全新國語專輯「守護者」\n\n全新專輯「守護者」，首波主打單曲「寬恕」，描述人與人之間在理性與感性之間的掙扎，Yuming以歌聲默默守護女生，美珍用情感為女生而唱，引人入勝的闡釋女生面對背叛、情感上的驚濤波折，究竟要選擇憤怒或是寬恕？而在這首「寬恕」的音樂錄影帶中，導演也巧妙的運用了從全黑到全白的場景，再到置身於特效的火雨及烈焰中的強烈視覺，象徵著心情由悲傷到釋懷，繼而浴火重生的轉折。', '2010-06-04 00:00:00', 2010, 19, 0, 7, '', '', 294, '', '阿弟仔', '阿弟仔', '', '', '', 0, 1, 0, '2014-05-05 21:39:39', '2015-03-12 14:06:25', '0000-00-00 00:00:00'),
