(74748, 228793, 6771, 1, '瑪莉海', '2010 櫻桃幫 第三張全新創作專輯《only》，2010年，她們依舊大聲唱著歌要讓世人聽見，然而，櫻桃幫在渡過了成長的拉扯之後，\n拋開教條，卸下包袱，這一次，櫻桃樹 更加茁壯，櫻桃果實 也更加豔麗。沈寂兩年半，全新蛻變後的 櫻桃幫 從心出發櫻桃幫《only》，櫻桃幫式的獨一無二創作十首全新創作歌曲，唱出十種櫻桃幫對世界的吶喊她們用音樂收藏你的悲傷，用音樂與聽見的你(妳)互相鼓勵著，\n她們用音樂看清了自己的模樣，用音樂安心的餵養著夢想長大。\n', '2010-11-11 00:00:00', 2010, 19, 0, 7, '', '', 199, '', '大恬', '大恬', '', '', '', 0, 1, 0, '2014-05-05 21:39:56', '2015-03-12 14:06:26', '0000-00-00 00:00:00'),
