(74759, 218993, 0, 1, '西瓜牛奶 (不插電版)', '夏天對你來說是什麼呢?\n對鬍子船長來說~夏天就是~~\n和喜歡的人一起吹著微風喝著沁涼可口的西瓜牛奶~\n就算突然下起西北雨也不會覺得掃興~~~\n\n可惜今天船長們跑了五家飲料店都找無西瓜牛奶...\n那就只好聽著《西瓜牛奶》找回往日夏天和雨水的氣味~', '2013-01-01 00:00:00', 2000, 19, 1, 5, '詞曲：老蕭  編曲：鬍子船長\n\n哩嘎我工 夏天ㄟ滋味              (妳跟我說 夏天的滋味)\n係學校ㄟ豆花 哇聽嚨無            (是學校的豆花 我聽不懂)\n哇肝那知影 哪係都好屋西北雨      (我只知道 要是剛好有西北雨)\n丟ㄟ賽做伙走路 因為哩驚撣雷公    (就可以一起走路 因為妳怕打雷)\n\n係哩寫ㄟ字 阿係哩頭毛ㄟ香味      (是妳寫的字 還是妳頭髮的香味)\n原來世界 金價屋天使ㄟ存在        (原來世界 真的有天使的存在)\n\n想妹嘎哩到頂做伙                 (想要和妳在一起)\n親像西瓜配哇尚愛ㄟ牛奶           (就像西瓜配我最愛的牛奶)\n但哩公哩其實對牛奶ㄟ過敏         (但妳說妳其實對牛奶會過敏)\n那哩嗎ㄟ賽肝哪呷西瓜             (那妳也可以只吃西瓜)\n\n西瓜牛奶 自從哇跨丟哩ㄟ笑忙      (西瓜牛奶 自從我看到妳的笑容)\n哇丟想妹嘎哩到頂拎               (我就想要跟妳一起喝)', '', 231, '', '', '', '', '鬍子船長', '', 0, 1, 0, '2014-05-05 23:49:26', '2015-03-12 14:06:26', '0000-00-00 00:00:00'),
