(74762, 132722, 0, 1, '頻率', '很多時後,人們的情感是交錯複雜,苦辣酸甜很難一句話能夠說的清,相聚的驚喜,分離的落寞,總有個特殊的連結,把彼此的生命兜在一起,串聯這些的,就是彼此之間,熟悉的頻率', '2014-01-01 00:00:00', 2000, 19, 2, 1, '離開了妳\n重新呼吸可以思考的空氣\n回首過去\n是灘讓人陷入困惑的泥\n\n並沒有怪你\n那些啃食快樂成癮的沉溺\n陪我從黑暗到黎明\n\n我們的腳步可能不會再對齊\n我們會聽見更多不同的旋律\n會看到更多\n你的眼睛還有對未來的熱情\n\n我們的腳步可能不會再對齊\n我們會遇見更多不同的人群\n不要說 謝謝你的陪伴 那麼矯情\n還能感應\n那熟悉的頻率\n', '', 269, '', '', '', '', '嗆綠青椒', '', 0, 1, 0, '2014-05-06 13:23:53', '2015-03-12 14:06:26', '0000-00-00 00:00:00'),
(74763, 191640, 6772, 1, '滾滾滾', '', '2014-05-06 00:00:00', 2000, 19, 1, 4, '		      滾滾滾\n	\n你給我滾滾別管我\n你給我滾滾 別管我\n不要不要再來煩我  你去你去照照鏡子  你就會發現你很沒sense\n你給我滾滾別管我       \n你給我滾滾別管我\n由我創造時尚風潮       不怕不怕別人嘲笑    別管我的時尚模樣\n\n要我來教你先跪下吧   還要說師傅您好\n不要不要批評我的想法  \n不要不要批評我的想法   頭髮頭髮頭髮一定要這樣你想說說說    你想說說說    你想說說說什麼 哼你想說說說     你想說說說   你想說說說什麼 哼是時候            讓你知道誰是老大   不是你也不是他\n你給我滾滾別管我    你給我滾滾別管我\n你給我滾滾別管我    你給我滾滾別管我\n時尚時尚故我在   因為時尚由我主宰    我是我是時尚老大\n你給我滾滾別管我    \n你給我滾滾別管我\n我的世界不用你管   你的衣櫃由我來管     還有你的梳妝台   Ho.. Ho.. ho… fashion is my (life)     ho..ho..ho… my life\n不要不要再煩我                  快點快點讓我靜下\n你要遵命還要聽你的老大    只有我能有想法\n不要不要再講話                  服裝服裝一定要醬\n不想要跟我爭論我的想法    誰才是你的老大\n\n讓我來做主你滾滾吧     讓我來做主你滾滾吧\n不要來煩我你滾滾吧     不要來煩我你滾滾吧\n	別管別管我的頭髮     別管別管我的服裝時尚時尚由我主宰    這不需要理解明白時尚時尚故我在\n', '', 217, '', '', '', '', '可人', '', 0, 0, 0, '2014-05-06 14:37:31', '2015-03-12 14:06:26', '0000-00-00 00:00:00'),
