(74766, 191640, 6772, 4, '美麗人生', '詞●曲●鋼琴:李可人', '2014-05-06 00:00:00', 2000, 19, 1, 4, '當我看到你一人獨自在病房角落\n電視不看廣播不聽也不吃點什麼\n無助的哭無奈的笑不削的看著我\n希望幫助你脫離黑洞\n\n過去你健全還能環遊這世界一週\n誰知道在意外中吹了一把中風\n我能怎麼辦只好為你天天祈求\n唱首歌求你別再拒絕我\n\n如果願意  展開笑容\n因為上帝愛笑容  祂以笑容幫助你我\n不怕憂愁欺負我\n\n不放棄美麗人生  不要無可奈何\n因為你可以戰勝\n人生雖然是無常  但也是個未知\n你怎能斷定人生\n就算真的不能  但只要堅持過了\n就不會不會後悔這輩子  \n因你擁有美麗人生\n\n如果我跟你說人生是起伏不順的\n當你失落時總有一位上帝在看顧的\n你可能認為我又在跟你虎爛瞎扯\n看看天空想想是誰造你就會懂的\n\n這人生是美麗但一定是不完美的\n難道被命運捉弄你就這樣投降了\n這世上多少人像你一樣辛苦的\n看看那些人是如何從地上爬起來的\n美麗人生是不許你輕易放棄的\n\n不放棄美麗人生  不要無可奈何\n因為你可以戰勝\n人生雖然是無常  但也是個未知\n你怎能斷定人生\n就算真的不能  但只要堅持過了\n就不會不會後悔這輩子\n因你擁有美麗人生\n\n如果願意  展開笑容\n因為上帝愛笑容  祂以笑容幫助你我\n不怕憂愁欺負我\n\n不放棄美麗人生  不要無可奈何\n因為你可以戰勝\n人生雖然是無常  但也是個未知\n你怎能斷定人生\n就算真的不能  但只要堅持過了\n就不會不會後悔這輩子\n因你擁有美麗人生\n\n不放棄美麗人生  不要無可奈何\n因為你可以戰勝\n人生雖然是無常  但也是個未知\n你怎能斷定人生\n就算真的不能  但只要堅持過了\n就不會不會後悔這輩子\n因你擁有美麗人生\n', '', 272, '', '可人', '可人', '', '可人', '', 0, 0, 0, '2014-05-06 14:46:48', '2015-03-12 14:06:27', '0000-00-00 00:00:00'),
(74767, 191640, 6772, 5, '說我愛你', '詞●曲●鋼琴:李可人', '2014-05-06 00:00:00', 2000, 19, 1, 4, '			快說我愛你 \n		               曲詞:李可人\n\n\n\n不要每天都苦苦的等你  不要每天都停留在原地\n看著你看著我不用說什麼就可以懂  因為正負相吸\n\n你要清楚我們倆人 現在的處境  不要遲疑相信自己  我會慢慢聽\n對你自己要有信心 用盡你所有勇氣  我會等著你     說我愛你\n\n千萬不要一再逼我生氣  為什麼每一事都有原因\n難道不能就這麼一次放鬆自己  你要放鬆自己\n\n每個晚上都想個你不停  帶興奮心情想睡都不行\n快樂心情是每一天最重要約定  不要暫停  不要留原地\n\n每天都保持著愉快心情  珍惜每一刻的點點滴滴\n每天都期盼著明天會發生何事  因為你而開心\n快點說不要停 每天都期待著你 聽你最終的決定\n\nBV: 你要相信自己  說話要仔細  不要再遲疑\n\n\n你要清楚我們倆人 現在的處境  不要遲疑相信自己  我會慢慢聽\n對你自己要有信心 用盡你所有勇氣  我會等著你\n\n你要專心不要懷疑 相信你自己  不要以為這樣就是    所謂在一起\n每天定時胡言亂語 蹦蹦跳緊張心情  不再遲疑      快作決定\n\n不要一再跟我說那些因為所以   蟑螂和螞蟻都可以有結婚典禮  \n我們倆人的關係不只這樣而已   快作決定      不然不理你\n\n		快作決定          說我  愛你\n		快作決定          說我  愛你\n		快作決定          說我  愛你\n		快作決定          說我  愛你\n', '', 219, '', '可人', '可人', '', '可人', '', 0, 0, 0, '2014-05-06 14:49:12', '2015-03-12 14:06:27', '0000-00-00 00:00:00'),
