(74769, 191640, 6772, 6, '我要唱著歌', '詞●曲●鋼琴:李可人', '2014-05-06 00:00:00', 2000, 19, 1, 4, '我要唱著歌 到天明\n趴踢 趴踢 趴踢\n\n走著走著走到你家裡\n看著看著你就來趴踢\n不懂不懂不懂你問題\n現在是最嗨的心情\n我不要不要一再迴避\n小鹿小鹿亂撞是心情\n跟你跟你跟你來啪踢\n要一直唱到天明\n我要唱著歌 到天明\n趴踢 趴踢 趴踢 趴踢 趴踢*2\n\n沒人沒人沒人會在意\n你我你我你我的心情\n我想嗨想嗨直到天明\n我要唱著歌到天明\n一二三四五六起  立\n看著看著看著看你你\n搖擺搖擺搖你的身體\n嗨翻這屋頂\n我要唱著歌 到天明\n趴踢 趴踢 趴踢 趴踢 趴踢*2\n\n我要唱著歌*2                                  我要唱著歌*4\n我要唱著歌 到天明	                            唱著 唱著 唱著\n趴踢 趴踢 趴踢 趴踢	                     我要唱著歌\n\n我要唱著歌 到天明\n趴踢 趴踢 趴踢*2\n', '', 258, '', '可人', '可人', '', '可人', '', 0, 0, 0, '2014-05-06 14:52:11', '2015-03-12 14:06:27', '0000-00-00 00:00:00'),
