(74771, 191640, 6772, 7, '寫給你的歌', '詞●曲:李可人', '2014-05-06 00:00:00', 2000, 19, 1, 4, '這是一首寫給你的歌\n希望你能夠聽見\n我卻自己都不知道\n我能為你做些什麼\n\n每天時光總會離去\n今天總也隨之過去\n就算時間漸漸過了\n記憶卻留在那時刻 \n\n人們總是假裝忘記\n自己不愉快的事\n好事壞事自己記得\n那是甜蜜心痛的\n\n過去的事不能再一次\n而自己要為過去負責             \n一天一天害怕的影子\n在心中揮不去\n\n真希望能在你面前\n深深的向你道歉\n漸漸長大後\n才了解罪不能安心入眠\n\n用眼淚換取明天\n記憶無法離開臉\n我求你能聽我說\n讓我對得起自己一天\n\n每一天都有過去的畫面\n每一天都有過去的餘煙\n每一天都有過去的心扉\n我怎麼都忘不去你的臉\n\n一天比一天都還要再後悔\n一天比一天都還要再懺悔\n過去的是忘不去烙在心裡面\n求上帝讓我入眠真\n\n希望能在你面前深深的向你道歉\n漸漸長大後才了解罪不能安心入眠\n用眼淚換取明天\n記憶無法離開臉\n我求你聽我說\n讓我安心一天\n\n這是一首寫給你的歌希望你能夠聽見\n', '', 285, '', '可人', '可人', '', '可人', '', 0, 0, 0, '2014-05-06 14:55:41', '2015-03-12 14:06:27', '0000-00-00 00:00:00'),
(74772, 191640, 6772, 8, '聖誕小姐', '詞●曲●鋼琴:李可人', '2014-05-06 00:00:00', 2000, 19, 1, 4, '              聖誕小姐  \n                       曲詞:李可人 \n\n	You better watch out You better not cry\n        You better not pout I''m telling you why\n	Santa Claus is coming to town\n\n我今天又到碼頭邊    上課的心情讓我厭\n今天是聖誕節我永遠不會忘的一天\n我不要一再像從前    無聊每天都覺得厭\n我要讓今夜成為最完美的宴 \n我從不覺得孤單       但要讓今晚變的非常好玩的一天一夜\n\nDoDoDoDoDoDo BaBa   DoDoDoDoDoDoBaBa\n今天的夜景是我從來沒見過的美\n我不要讓今天荒廢把雙手放開一切\n讓一切都自然不放開任何機會\n今天每一刻都要讓我醉\nDoDoDoDoDoDo BaBa   DoDoDoDoDoDoBaBa\n看到任何人我都要上去灌醉   嘿嘿\n\n明天還很久今天要狂歡玩到底\n不要停不要停不要讓一切止息\n\n聖誕的一天不能忘記  讓今天成為我的回憶\n唱歌跳舞  唱歌跳舞  唱歌跳舞  唱歌跳舞  唱嘿\n\n	  	 DoDoDoDoDoDo BaBa   DoDoDoDoDoDoBaBa 		\n跳舞跳舞跳舞跳到天亮雞鳴才醒\n		 DoDoDoDoDoDo BaBa   DoDoDoDoDoDoBaBa 		\n不讓今天荒廢放開完到底\n\n今天聖誕要狂歡  不像以前發呆  \n讓我成為今夜焦點  因為我是世界聖誕小姐\n\nHe''s making a list\nHe''s checking it twice \nHe''s gonna find out \nwho''s naughty or nice\nSanta Claus is coming to town!\n\n	   DoDoDoDoDoDo BaBa   DoDoDoDoDoDoBaBa 		   \n跳舞跳舞跳舞跳到天亮雞鳴才醒\n	   DoDoDoDoDoDo BaBa   DoDoDoDoDoDoBaBa 		   \n不讓今天荒廢放開完到底\n', '', 238, '', '可人', '可人', '', '可人', '', 0, 0, 0, '2014-05-06 14:58:26', '2015-03-12 14:06:27', '0000-00-00 00:00:00'),
(74773, 191640, 6772, 9, '好的朋友', '詞●曲●鋼琴:李可人', '2014-05-06 00:00:00', 2000, 19, 1, 4, '我的好好好的朋友\n                                                                    詞曲:李可人\n\n\n我和我我的朋友\n喔走在小小街頭\n你和我都勾勾勾手\n走在小小路上很威風\n\n嘿 我們在坐小小街頭\n喔看著你又看著我\n不用說你我都很懂\n吃著冰淇淋看著你我\n\n我有我我的好的朋友\n傻傻笑笑看著你我\n沒有任何事可以阻擋你我\n        我的好的好的好的好的好的朋友\n        我的好的好的好的朋友*4\n        我的好好好好的朋友\n        我的最最好的朋友\n        我的好好好 我最好的朋友\n\n認識你都幾十年了\n我們的友誼不會變的\n看著你笑都幾十年了\n你和我之間沒人懂得\n\n什麼事情是沒走過的\n你失戀還是你結婚了\n我都在旁邊陪你走的\n開心難過都是一起的\n', '', 196, '', '可人', '可人', '', '可人', '', 0, 0, 0, '2014-05-06 15:00:35', '2015-03-12 14:06:27', '0000-00-00 00:00:00'),
